import React from "react";
import { Link } from "react-router-dom";
import articleContent from "./article-content";

const ArticlesList = () => (
  <>
    <h1>Articles</h1>
    {articleContent.map((article) => (
      <Link>
        <h3>{article.title}</h3>
        <p>{article.content[0].substr}</p>
      </Link>
    ))}
  </>
);

export default ArticlesList;
